NETGEN_Parameters.SetMaxSize( 5 )
NETGEN_Parameters.SetMinSize( 1 )
NETGEN_Parameters.SetSecondOrder( 1 )
NETGEN_Parameters.SetOptimize( 1 )
NETGEN_Parameters.SetFineness( 4 )
